import { useState, useEffect } from 'react';
import './App.css';
import { motion } from 'framer-motion';


const images = [
  '/images/hero1.jpg',
  '/images/hero2.jpg',
  '/images/hero3.jpg',
];

function App() {
  const [current, setCurrent] = useState(0);

  useEffect(() => {
    const timer = setInterval(() => {
      setCurrent((prev) => (prev + 1) % images.length);
    }, 4000);
    return () => clearInterval(timer);
  }, []);

  return (
    <div className="w-full overflow-x-hidden text-white">
      {/* Hero Section with Background Transition */}
      <div className="relative h-screen w-full overflow-hidden">
        {images.map((img, index) => (
          <div
            key={index}
            className={`absolute top-0 left-0 h-full w-full bg-cover bg-center transition-opacity duration-1000 ease-in-out ${
              current === index ? 'opacity-100 z-10' : 'opacity-0 z-0'
            }`}
            style={{ backgroundImage: `url(${img})` }}
          />
        ))}

        {/* Overlay */}
        <div className="absolute top-0 left-0 h-full w-full bg-black bg-opacity-30 z-20" />

        {/* Navbar */}
        <nav className="relative z-30 flex justify-between items-center px-8 py-6 bg-black bg-opacity-30">
          <h1 className="text-2xl font-bold">Sign Galaxy</h1>
          <ul className="flex space-x-6 text-lg font-medium">
            <li className="hover:text-yellow-300 transition duration-100 cursor-pointer">Home</li>
<li>
  <a href="#about" className="hover:text-yellow-300 transition duration-300">About Us</a>
</li>
            <li className="hover:text-yellow-300 transition duration-100 cursor-pointer">Services</li>
            <li className="hover:text-yellow-300 transition duration-100 cursor-pointer">Contact</li>
          </ul>
        </nav>

        {/* Hero Quote */}
        <div className="relative z-30 flex items-center justify-center h-screen px-6 text-center -translate-y-10">
          <div>
            <h2 className="text-5xl md:text-6xl font-bold drop-shadow-md transition-all duration-1000 ease-in-out">
              Elevate Spaces with Sign Galaxy
            </h2>
            <p className="mt-4 text-xl text-gray-100">
              Crafting bold impressions through signs, interiors, and exteriors.
            </p>
          </div>
        </div>
      </div>

      {/* About Us Section */}
      <section className="bg-gradient-to-b from-black via-gray-900 to-black py-20 px-6 text-white" id="about">
        <div className="max-w-5xl mx-auto text-center">
          <h2 className="text-4xl font-bold mb-6 text-yellow-300">About Us</h2>
          <p className="text-lg leading-8 mb-8">
            At <span className="font-semibold text-white">Sign Galaxy</span>, we specialize in transforming ordinary
            spaces into extraordinary expressions. With over 6 years of expertise in{' '}
            <span className="text-yellow-300">interior</span>, <span className="text-yellow-300">exterior</span>, and{' '}
            <span className="text-yellow-300">signage</span> design, we craft experiences that speak louder than
            words. Every detail is handled in-house to ensure precision, quality, and creativity without compromise.
          </p>
          <img
            src="/assets/about-us.jpg"
            alt="Our Workspace"
            className="mx-auto rounded-2xl shadow-xl w-full max-w-3xl opacity-90 hover:opacity-100 transition-opacity duration-500"
          />
{/* Founder Story */}
<div className="mt-12 text-left max-w-3xl mx-auto">
  <h3 className="text-3xl font-bold text-yellow-300 mb-4">Meet Our Founder</h3>
  <p className="mb-4">
    Welcome to <span className="font-semibold text-white">Sign Galaxy</span>, driven by a passion for creating captivating spaces.
    Our young founder has made remarkable strides in the interior and exterior industry, transforming ordinary spaces into extraordinary masterpieces.
  </p>
  <p className="mb-4">
    Emerging from the heart of <span className="text-yellow-300">Ballari</span>, our founder has become a beacon of inspiration in the design world.
    With an innovative approach and an eye for detail, they have left an indelible mark on the local architecture scene.
  </p>
  <p className="mb-4">
    With unwavering commitment to elegance and precision, we have revolutionized local aesthetics — bringing a touch of sophistication to every project we touch.
  </p>
  <p className="mb-4">
    Browse our portfolio for inspiration and visit our blog for expert advice. Join us on this design journey and let’s transform your space into something truly remarkable!
  </p>
</div>

          {/* Feature Cards */}
          <div className="mt-12 flex flex-wrap justify-center gap-6">
            <div className="w-64 bg-yellow-100 text-gray-800 rounded-xl shadow p-6 hover:shadow-lg transition duration-300">
              <h3 className="text-xl font-semibold text-yellow-700 mb-2">Creative Designs</h3>
              <p>Modern and visually stunning ideas crafted just for your brand.</p>
            </div>
            <div className="w-64 bg-yellow-100 text-gray-800 rounded-xl shadow p-6 hover:shadow-lg transition duration-300">
              <h3 className="text-xl font-semibold text-yellow-700 mb-2">End-to-End Execution</h3>
              <p>From concept to completion — we manage it all under one roof.</p>
            </div>
            <div className="w-64 bg-yellow-100 text-gray-800 rounded-xl shadow p-6 hover:shadow-lg transition duration-300">
              <h3 className="text-xl font-semibold text-yellow-700 mb-2">Customer Satisfaction</h3>
              <p>We build long-lasting relationships through exceptional service.</p>

            </div>
          </div>
        </div>
      </section>
    </div>
  );
}

export default App;
